  false,\n\t\"url\": null,\n\t\"notes\": \"During a collaborative project in 1992,
  a Canadian Geological Survey cruise obtained about 850 line-km of high-quality boomer
  and sleeve-gun reflection profiles across Hueneme, Mugu and Dume submarine fans,
  Santa Monica Basin, off southern California. The goals of this work were to better
  understand the processes that lead to the formation of sandy submarine fans and
  the role of sea-level changes in controlling fan development. This report includes
  a trackline map of the area surveyed, as well as images of the sleeve-gun profiles
  and the opportunity to download both images and digital data files (SEG-Y) of all
  the profiles. For more information on the seismic surveys see http://walrus.wr.usgs.gov/infobank/p/p192sc/html/p-1-92-sc.meta.html
  These data are also available via GeoMapApp (http://www.geomapapp.org/) and Virtual
  Ocean (http://www.virtualocean.org/) earth science exploration and visualization
  applications.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
